import PropTypes from 'prop-types'

class LoginNav extends Component {
    constructor(props){
        super(props)
        this.profile = this.profile.bind(this)
    }
    static propTypes = {
        atuh: PropTypes.object.isRequired
    }

    // const user = localStorage.getItem('authUser')
