    profile(){
        history.push('/profile');
    }
    render() {
        return (
        <>
        <Navbar>
            <Navbar.Brand href="/home" style={{color: "black"}} className="col-md-9 col-sm-6">
            <img
                alt=""
                src="../logo192.png"
                width="30"
                height="30"
                className="d-inline-block align-top"
            />{' '}
            Splitwise
            {' '}
            </Navbar.Brand>
            <Nav className="justify-content-end" activeKey="/home">
                <Nav.Item>
                <Nav.Link href="/dashboard">Dashboard</Nav.Link>
                </Nav.Item>
                <NavDropdown title={this.props.name} id="nav-dropdown">
                    <NavDropdown.Item eventKey="4.1">Profile<Redirect to="/profile" /></NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item eventKey="4.4" onClick={logout}>Logout</NavDropdown.Item>
                </NavDropdown>
            </Nav>
        </Navbar>
        </>
        )
    }
}

export default LoginNav
